name, integer, integer); Type: FUNCTION; Schema: realtime; Owner: ---CREATE FUNCTION realtime.list_changes(publication name, slot_name name, max_changes integer, max_record_bytes integer) RETURNS SETOF realtime.wal_rlsLANGUAGE sqlSET log_min_messages TO 'fatal'AS $$with pub as (selectconcat_ws(',',case when bool_or(pubinsert) then 'insert' else null end,case when bool_or(pubupdate) then 'update' else null end,case when bool_or(pubdelete) then 'delete' else null end) as w2j_actions,coalesce(string_agg(realtime.quote_wal2json(format('%I.%I', schemaname, tablename)::regclass),',') filter (where ppt.tablename is not null and ppt.tablename not like '% %'),'') w2j_add_tablesfrompg_publication ppleft join pg_publication_tables ppton pp.pubname = ppt.pubnamewherepp.pubname = publicationgroup bypp.pubnamelimit 1),w2j as (selectx.*, pub.w2j_add_tablesfrompub,pg_logical_slot_get_changes(slot_name, null, max_changes,'include-pk', 'true','include-transaction', 'false','include-timestamp', 'true','include-type-oids', 'true','format-version', '2','actions', pub.w2j_actions,'add-tables', pub.w2j_add_tables) x)selectxyz.wal,xyz.is_rls_enabled,xyz.subscription_ids,xyz.errorsfromw2j,realtime.apply_rls(wal := w2j.data::jsonb,max_record_bytes := max_record_bytes) xyz(wal, is_rls_enabled, subscription_ids, errors)wherew2j.w2j_add_tables <> ''and xyz.subscription_ids[1] is not null$$;---- Name: quote_wal2json(regclass); Type: FUNCTION; Schema: realtime; Owner: ---CREATE FUNCTION realtime.quote_wal2json(entity regclass) RETURNS textLANGUAGE sql IMMUTABLE STRICTAS $$select(select string_agg('' || ch,'')from unnest(string_to_array(nsp.nspname::text, null)) with ordinality x(ch, idx)wherenot (x.idx = 1 and x.ch = '"')and not (x.idx = array_length(string_to_array(nsp.nspname::text, null), 1)and x.ch = '"'))|| '.'|| (select string_agg('' || ch,'')from unnest(string_to_array(pc.relname::text, null)) with ordinality x(ch, idx)wherenot (x.idx = 1 and x.ch = '"')and not (x.idx = array_length(string_to_array(nsp.nspname::text, null), 1)and x.ch = '"'))frompg_class pcjoin pg_namespace nspon pc.relnamespace = nsp.oidwherepc.oid = entity$$;---- Name: send(jsonb, text, text, boolean); Type: FUNCTION; Schema: realtime; Owner: ---CREATE FUNCTION realtime.send(payload jsonb, event text, topic text, private boolean DEFAULT true) RETURNS voidLANGUAGE plpgsqlAS $$DECLAREgenerated_id uuid;final_payload jsonb;BEGINBEGIN-- Generate a new UUID for the idgenerated_id := gen_random_uuid();-- Check if payload has an 'id' key, if not, add the generated UUIDIF payload ? 'id' THENfinal_payload := payload;ELSEfinal_payload := jsonb_set(payload, '{id}', to_jsonb(generated_id));END IF;-- Set the topic configurationEXECUTE format('SET LOCAL realtime.topic TO %L', topic);-- Attempt to insert the messageINSERT INTO realtime.messages (id, payload, event, topic, private, extension)VALUES (generated_id, final_payload, event, topic, private, 'broadcast');EXCEPTIONWHEN OTHERS THEN-- Capture and notify the errorRAISE WARNING 'ErrorSendingBroadcastMessage: %', SQLERRM;END;END;$$;---- Name: subscription_check_filters(); Type: FUNCTION; Schema: realtime; Owner: ---CREATE FUNCTION realtime.subscription_check_filters() RETURNS triggerLANGUAGE plpgsqlAS $$/*Validates that the user defined filters for a subscription:- refer to valid columns that the claimed role may access- values are coercable to the correct column type*/declarecol_names text[] = coalesce(array_agg(c.column_name order by c.ordinal_position),'{}'::text[])frominformation_schema.columns cwhereformat('%I.%I', c.table_schema, c.table_name)::regclass = new.entityand pg_catalog.has_column_privilege((new.claims ->> 'role'),format('%I.%I', c.table_schema, c.table_name)::regclass,c.column_name,'SELECT');filter realtime.user_defined_filter;col_type regtype;in_val jsonb;beginfor filter in select * from unnest(new.filters) loop-- Filtered column is validif not filter.column_name = any(col_names) thenraise exception 'invalid column for filter %', filter.column_name;end if;-- Type is sanitized and safe for string interpolationcol_type = (select atttypid::regtypefrom pg_catalog.pg_attributewhere attrelid = new.entityand attname = filter.column_name);if col_type is null thenraise exception 'failed to lookup type for column %', filter.column_name;end if;-- Set maximum number of entries for in filterif filter.op = 'in'::realtime.equality_op thenin_val = realtime.cast(filter.value, (col_type::text || '[]')::regtype);if coalesce(jsonb_array_length(in_val), 0) > 100 thenraise exception 'too many values for `in` filter. Maximum 100';end if;else-- raises an exception if value is not coercable to typeperform realtime.cast(filter.value, col_type);end if;end loop;-- Apply consistent order to filters so the unique constraint on-- (subscription_id, entity, filters) can't be tricked by a different filter ordernew.filters = coalesce(array_agg(f order by f.column_name, f.op, f.value),'{}') from unnest(new.filters) f;return new;end;$$;---- Name: to_regrole(text); Type: FUNCTION; Schema: realtime; Owner: ---CREATE FUNCTION realtime.to_regrole(role_name text) RETURNS regroleLANGUAGE sql IMMUTABLEAS $$ select role_name::regrole $$;---- Name: topic(); Type: FUNCTION; Schema: realtime; Owner: ---CREATE FUNCTION realtime.topic() RETURNS textLANGUAGE sql STABLEAS $$select nullif(current_setting('realtime.topic', true), '')::text;$$;---- Name: add_prefixes(text, text); Type: FUNCTION; Schema: storage; Owner: ---CREATE FUNCTION storage.add_prefixes(_bucket_id text, _name text) RETURNS voidLANGUAGE plpgsql SECURITY DEFINERAS $$DECLAREprefixes text[];BEGINprefixes := "storage"."get_prefixes"("_name");IF array_length(prefixes, 1) > 0 THENINSERT INTO storage.prefixes (name, bucket_id)SELECT UNNEST(prefixes) as name, "_bucket_id" ON CONFLICT DO NOTHING;END IF;END;$$;---- Name: can_insert_object(text, text, uuid, jsonb); Type: FUNCTION; Schema: storage; Owner: ---CREATE FUNCTION storage.can_insert_object(bucketid text, name text, owner uuid, metadata jsonb) RETURNS voidLANGUAGE plpgsqlAS $$BEGININSERT INTO "storage"."objects" ("bucket_id", "name", "owner", "metadata") VALUES (bucketid, name, owner, metadata);-- hack to rollback the successful insertRAISE sqlstate 'PT200' usingmessage = 'ROLLBACK',detail = 'rollback successful insert';END$$;---- Name: delete_leaf_prefixes(text[], text[]); Type: FUNCTION; Schema: storage; Owner: ---CREATE FUNCTION storage.delete_leaf_prefixes(bucket_ids text[], names text[]) RETURNS voidLANGUAGE plpgsql SECURITY DEFINERAS $$DECLAREv_rows_deleted integer;BEGINLOOPWITH candidates AS (SELECT DISTINCTt.bucket_id,unnest(storage.get_prefixes(t.name)) AS nameFROM unnest(bucket_ids, names) AS t(bucket_id, name)),uniq AS (SELECTbucket_id,name,storage.get_level(name) AS levelFROM candidatesWHERE name <> ''GROUP BY bucket_id, name),leaf AS (SELECTp.bucket_id,p.name,p.levelFROM storage.prefixes AS pJOIN uniq AS uON u.bucket_id = p.bucket_idAND u.name = p.nameAND u.level = p.levelWHERE NOT EXISTS (SELECT 1FROM storage.objects AS oWHERE o.bucket_id = p.bucket_idAND o.level = p.level + 1AND o.name COLLATE "C" LIKE p.name || '/%')AND NOT EXISTS (SELECT 1FROM storage.prefixes AS cWHERE c.bucket_id = p.bucket_idAND c.level = p.level + 1AND c.name COLLATE "C" LIKE p.name || '/%'))DELETEFROM storage.prefixes AS pUSING leaf AS lWHERE p.bucket_id = l.bucket_idAND p.name = l.nameAND p.level = l.level;GET DIAGNOSTICS v_rows_deleted = ROW_COUNT;EXIT WHEN v_rows_deleted = 0;END LOOP;END;$$;---- Name: delete_prefix(text, text); Type: FUNCTION; Schema: storage; Owner: ---CREATE FUNCTION storage.delete_prefix(_bucket_id text, _name text) RETURNS booleanLANGUAGE plpgsql SECURITY DEFINERAS $$BEGIN-- Check if we can delete the prefixIF EXISTS(SELECT FROM "storage"."prefixes"WHERE "prefixes"."bucket_id" = "_bucket_id"AND level = "storage"."get_level"("_name") + 1AND "prefixes"."name" COLLATE "C" LIKE "_name" || '/%'LIMIT 1)OR EXISTS(SELECT FROM "storage"."objects"WHERE "objects"."bucket_id" = "_bucket_id"AND "storage"."get_level"("objects"."name") = "storage"."get_level"("_name") + 1AND "objects"."name" COLLATE "C" LIKE "_name" || '/%'LIMIT 1) THEN-- There are sub-objects, skip deletionRETURN false;ELSEDELETE FROM "storage"."prefixes"WHERE "prefixes"."bucket_id" = "_bucket_id"AND level = "storage"."get_level"("_name")AND "prefixes"."name" = "_name";RETURN true;END IF;END;$$;---- Name: delete_prefix_hierarchy_trigger(); Type: FUNCTION; Schema: storage; Owner: ---CREATE FUNCTION storage.delete_prefix_hierarchy_trigger() RETURNS triggerLANGUAGE plpgsqlAS $$DECLAREprefix text;BEGINprefix := "storage"."get_prefix"(OLD."name");IF coalesce(prefix, '') != '' THENPERFORM "storage"."delete_prefix"(OLD."bucket_id", prefix);END IF;RETURN OLD;END;$$;---- Name: enforce_bucket_name_length(); Type: FUNCTION; Schema: storage; Owner: ---CREATE FUNCTION storage.enforce_bucket_name_length() RETURNS triggerLANGUAGE plpgsqlAS $$beginif length(new.name) > 100 thenraise exception 'bucket name "%" is too long (% characters). Max is 100.', new.name, length(new.name);end if;return new;end;$$;---- Name: extension(text); Type: FUNCTION; Schema: storage; Owner: ---CREATE FUNCTION storage.extension(name text) RETURNS textLANGUAGE plpgsql IMMUTABLEAS $$DECLARE_parts text[];_filename text;BEGINSELECT string_to_array(name, '/') INTO _parts;SELECT _parts[array_length(_parts,1)] INTO _filename;RETURN reverse(split_part(reverse(_filename), '.', 1));END$$;---- Name: filename(text); Type: FUNCTION; Schema: storage; Owner: ---CREATE FUNCTION storage.filename(name text) RETURNS textLANGUAGE plpgsqlAS $$DECLARE_parts text[];BEGINselect string_to_array(name, '/') into _parts;return _parts[array_length(_parts,1)];END$$;---- Name: foldername(text); Type: FUNCTION; Schema: storage; Owner: ---CREATE FUNCTION storage.foldername(name text) RETURNS text[]LANGUAGE plpgsql IMMUTABLEAS $$DECLARE_parts text[];BEGIN-- Split on "/" to get path segmentsSELECT string_to_array(name, '/') INTO _parts;-- Return everything except the last segmentRETURN _parts[1 : array_length(_parts,1) - 1];END$$;---- Name: get_level(text); Type: FUNCTION; Schema: storage; Owner: ---CREATE FUNCTION storage.get_level(name text) RETURNS integerLANGUAGE sql IMMUTABLE STRICTAS $$SELECT array_length(string_to_array("name", '/'), 1);$$;---- Name: get_prefix(text); Type: FUNCTION; Schema: storage; Owner: ---CREATE FUNCTION storage.get_prefix(name text) RETURNS textLANGUAGE sql IMMUTABLE STRICTAS $_$SELECTCASE WHEN strpos("name", '/') > 0 THENregexp_replace("name", '[\/]{1}[^\/]+\/?$', '')ELSE''END;$_$;---- Name: get_prefixes(text); Type: FUNCTION; Schema: storage; Owner: ---CREATE FUNCTION storage.get_prefixes(name text) RETURNS text[]LANGUAGE plpgsql IMMUTABLE STRICTAS $$DECLAREparts text[];prefixes text[];prefix text;BEGIN-- Split the name into parts by '/'parts := string_to_array("name", '/');prefixes := '{}';-- Construct the prefixes, stopping one level below the last partFOR i IN 1..array_length(parts, 1) - 1 LOOPprefix := array_to_string(parts[1:i], '/');prefixes := array_append(prefixes, prefix);END LOOP;RETURN prefixes;END;$$;---- Name: get_size_by_bucket(); Type: FUNCTION; Schema: storage; Owner: ---CREATE FUNCTION storage.get_size_by_bucket() RETURNS TABLE(size bigint, bucket_id text)LANGUAGE plpgsql STABLEAS $$BEGINreturn queryselect sum((metadata->>'size')::bigint) as size, obj.bucket_idfrom "storage".objects as objgroup by obj.bucket_id;END$$;---- Name: list_multipart_uploads_with_delimiter(text, text, text, integer, text, text); Type: FUNCTION; Schema: storage; Owner: ---CREATE FUNCTION storage.list_multipart_uploads_with_delimiter(bucket_id text, prefix_param text, delimiter_param text, max_keys integer DEFAULT 100, next_key_token text DEFAULT ''::text, next_upload_token text DEFAULT ''::text) RETURNS TABLE(key text, id text, created_at timestamp with time zone)LANGUAGE plpgsqlAS $_$BEGINRETURN QUERY EXECUTE'SELECT DISTINCT ON(key COLLATE "C") * from (SELECTCASEWHEN position($2 IN substring(key from length($1) + 1)) > 0 THENsubstring(key from 1 for length($1) + position($2 IN substring(key from length($1) + 1)))ELSEkeyEND AS key, id, created_atFROMstorage.s3_multipart_uploadsWHEREbucket_id = $5 ANDkey ILIKE $1 || ''%'' ANDCASEWHEN $4 != '''' AND $6 = '''' THENCASEWHEN position($2 IN substring(key from length($1) + 1)) > 0 THENsubstring(key from 1 for length($1) + position($2 IN substring(key from length($1) + 1))) COLLATE "C" > $4ELSEkey COLLATE "C" > $4ENDELSEtrueEND ANDCASEWHEN $6 != '''' THENid COLLATE "C" > $6ELSEtrueENDORDER BYkey COLLATE "C" ASC, created_at ASC) as e order by key COLLATE "C" LIMIT $3'USING prefix_param, delimiter_param, max_keys, next_key_token, bucket_id, next_upload_token;END;$_$;---- Name: list_objects_with_delimiter(text, text, text, integer, text, text); Type: FUNCTION; Schema: storage; Owner: ---CREATE FUNCTION storage.list_objects_with_delimiter(bucket_id text, prefix_param text, delimiter_param text, max_keys integer DEFAULT 100, start_after text DEFAULT ''::text, next_token text DEFAULT ''::text) RETURNS TABLE(name text, id uuid, metadata jsonb, updated_at timestamp with time zone)LANGUAGE plpgsqlAS $_$BEGINRETURN QUERY EXECUTE'SELECT DISTINCT ON(name COLLATE "C") * from (SELECTCASEWHEN position($2 IN substring(name from length($1) + 1)) > 0 THENsubstring(name from 1 for length($1) + position($2 IN substring(name from length($1) + 1)))ELSEnameEND AS name, id, metadata, updated_atFROMstorage.objectsWHEREbucket_id = $5 ANDname ILIKE $1 || ''%'' ANDCASEWHEN $6 != '''' THENname COLLATE "C" > $6ELSE true ENDAND CASEWHEN $4 != '''' THENCASEWHEN position($2 IN substring(name from length($1) + 1)) > 0 THENsubstring(name from 1 for length($1) + position($2 IN substring(name from length($1) + 1))) COLLATE "C" > $4ELSEname COLLATE "C" > $4ENDELSEtrueENDORDER BYname COLLATE "C" ASC) as e order by name COLLATE "C" LIMIT $3'USING prefix_param, delimiter_param, max_keys, next_token, bucket_id, start_after;END;$_$;---- Name: lock_top_prefixes(text[], text[]); Type: FUNCTION; Schema: storage; Owner: ---CREATE FUNCTION storage.lock_top_prefixes(bucket_ids text[], names text[]) RETURNS voidLANGUAGE plpgsql SECURITY DEFINERAS $$DECLAREv_bucket text;v_top text;BEGINFOR v_bucket, v_top INSELECT DISTINCT t.bucket_id,split_part(t.name, '/', 1) AS topFROM unnest(bucket_ids, names) AS t(bucket_id, name)WHERE t.name <> ''ORDER BY 1, 2LOOPPERFORM pg_advisory_xact_lock(hashtextextended(v_bucket || '/' || v_top, 0));END LOOP;END;$$;---- Name: objects_delete_cleanup(); Type: FUNCTION; Schema: storage; Owner: ---CREATE FUNCTION storage.objects_delete_cleanup() RETURNS triggerLANGUAGE plpgsql SECURITY DEFINERAS $$DECLAREv_bucket_ids text[];v_names text[];BEGINIF current_setting('storage.gc.prefixes', true) = '1' THENRETURN NULL;END IF;PERFORM set_config('storage.gc.prefixes', '1', true);SELECT COALESCE(array_agg(d.bucket_id), '{}'),COALESCE(array_agg(d.name), '{}')INTO v_bucket_ids, v_namesFROM deleted AS dWHERE d.name <> '';PERFORM storage.lock_top_prefixes(v_bucket_ids, v_names);PERFORM storage.delete_leaf_prefixes(v_bucket_ids, v_names);RETURN NULL;END;$$;---- Name: objects_insert_prefix_trigger(); Type: FUNCTION; Schema: storage; Owner: ---CREATE FUNCTION storage.objects_insert_prefix_trigger() RETURNS triggerLANGUAGE plpgsqlAS $$BEGINPERFORM "storage"."add_prefixes"(NEW."bucket_id", NEW."name");NEW.level := "storage"."get_level"(NEW."name");RETURN NEW;END;$$;---- Name: objects_update_cleanup(); Type: FUNCTION; Schema: storage; Owner: ---CREATE FUNCTION storage.objects_update_cleanup() RETURNS triggerLANGUAGE plpgsql SECURITY DEFINERAS $$DECLARE-- NEW - OLD (destinations to create prefixes for)v_add_bucket_ids text[];v_add_names text[];-- OLD - NEW (sources to prune)v_src_bucket_ids text[];v_src_names text[];BEGINIF TG_OP <> 'UPDATE' THENRETURN NULL;END IF;-- 1) Compute NEW−OLD (added paths) and OLD−NEW (moved-away paths)WITH added AS (SELECT n.bucket_id, n.nameFROM new_rows nWHERE n.name <> '' AND position('/' in n.name) > 0EXCEPTSELECT o.bucket_id, o.name FROM old_rows o WHERE o.name <> ''),moved AS (SELECT o.bucket_id, o.nameFROM old_rows oWHERE o.name <> ''EXCEPTSELECT n.bucket_id, n.name FROM new_rows n WHERE n.name <> '')SELECT-- arrays for ADDED (dest) in stable orderCOALESCE( (SELECT array_agg(a.bucket_id ORDER BY a.bucket_id, a.name) FROM added a), '{}' ),COALESCE( (SELECT array_agg(a.name ORDER BY a.bucket_id, a.name) FROM added a), '{}' ),-- arrays for MOVED (src) in stable orderCOALESCE( (SELECT array_agg(m.bucket_id ORDER BY m.bucket_id, m.name) FROM moved m), '{}' ),COALESCE( (SELECT array_agg(m.name ORDER BY m.bucket_id, m.name) FROM moved m), '{}' )INTO v_add_bucket_ids, v_add_names, v_src_bucket_ids, v_src_names;-- Nothing to do?IF (array_length(v_add_bucket_ids, 1) IS NULL) AND (array_length(v_src_bucket_ids, 1) IS NULL) THENRETURN NULL;END IF;-- 2) Take per-(bucket, top) locks: ALL prefixes in consistent global order to prevent deadlocksDECLAREv_all_bucket_ids text[];v_all_names text[];BEGIN-- Combine source and destination arrays for consistent lock orderingv_all_bucket_ids := COALESCE(v_src_bucket_ids, '{}') || COALESCE(v_add_bucket_ids, '{}');v_all_names := COALESCE(v_src_names, '{}') || COALESCE(v_add_names, '{}');-- Single lock call ensures consistent global ordering across all transactionsIF array_length(v_all_bucket_ids, 1) IS NOT NULL THENPERFORM storage.lock_top_prefixes(v_all_bucket_ids, v_all_names);END IF;END;-- 3) Create destination prefixes (NEW−OLD) BEFORE pruning sourcesIF array_length(v_add_bucket_ids, 1) IS NOT NULL THENWITH candidates AS (SELECT DISTINCT t.bucket_id, unnest(storage.get_prefixes(t.name)) AS nameFROM unnest(v_add_bucket_ids, v_add_names) AS t(bucket_id, name)WHERE name <> '')INSERT INTO storage.prefixes (bucket_id, name)SELECT c.bucket_id, c.nameFROM candidates cON CONFLICT DO NOTHING;END IF;-- 4) Prune source prefixes bottom-up for OLD−NEWIF array_length(v_src_bucket_ids, 1) IS NOT NULL THEN-- re-entrancy guard so DELETE on prefixes won't recurseIF current_setting('storage.gc.prefixes', true) <> '1' THENPERFORM set_config('storage.gc.prefixes', '1', true);END IF;PERFORM storage.delete_leaf_prefixes(v_src_bucket_ids, v_src_names);END IF;RETURN NULL;END;$$;---- Name: objects_update_level_trigger(); Type: FUNCTION; Schema: storage; Owner: ---CREATE FUNCTION storage.objects_update_level_trigger() RETURNS triggerLANGUAGE plpgsqlAS $$BEGIN-- Ensure this is an update operation and the name has changedIF TG_OP = 'UPDATE' AND (NEW."name" <> OLD."name" OR NEW."bucket_id" <> OLD."bucket_id") THEN-- Set the new levelNEW."level" := "storage"."get_level"(NEW."name");END IF;RETURN NEW;END;$$;---- Name: objects_update_prefix_trigger(); Type: FUNCTION; Schema: storage; Owner: ---CREATE FUNCTION storage.objects_update_prefix_trigger() RETURNS triggerLANGUAGE plpgsqlAS $$DECLAREold_prefixes TEXT[];BEGIN-- Ensure this is an update operation and the name has changedIF TG_OP = 'UPDATE' AND (NEW."name" <> OLD."name" OR NEW."bucket_id" <> OLD."bucket_id") THEN-- Retrieve old prefixesold_prefixes := "storage"."get_prefixes"(OLD."name");-- Remove old prefixes that are only used by this objectWITH all_prefixes as (SELECT unnest(old_prefixes) as prefix),can_delete_prefixes as (SELECT prefixFROM all_prefixesWHERE NOT EXISTS (SELECT 1 FROM "storage"."objects"WHERE "bucket_id" = OLD."bucket_id"AND "name" <> OLD."name"AND "name" LIKE (prefix || '%')))DELETE FROM "storage"."prefixes" WHERE name IN (SELECT prefix FROM can_delete_prefixes);-- Add new prefixesPERFORM "storage"."add_prefixes"(NEW."bucket_id", NEW."name");END IF;-- Set the new levelNEW."level" := "storage"."get_level"(NEW."name");RETURN NEW;END;$$;---- Name: operation(); Type: FUNCTION; Schema: storage; Owner: ---CREATE FUNCTION storage.operation() RETURNS textLANGUAGE plpgsql STABLEAS $$BEGINRETURN current_setting('storage.operation', true);END;$$;---- Name: prefixes_delete_cleanup(); Type: FUNCTION; Schema: storage; Owner: ---CREATE FUNCTION storage.prefixes_delete_cleanup() RETURNS triggerLANGUAGE plpgsql SECURITY DEFINERAS $$DECLAREv_bucket_ids text[];v_names text[];BEGINIF current_setting('storage.gc.prefixes', true) = '1' THENRETURN NULL;END IF;PERFORM set_config('storage.gc.prefixes', '1', true);SELECT COALESCE(array_agg(d.bucket_id), '{}'),COALESCE(array_agg(d.name), '{}')INTO v_bucket_ids, v_namesFROM deleted AS dWHERE d.name <> '';PERFORM storage.lock_top_prefixes(v_bucket_ids, v_names);PERFORM storage.delete_leaf_prefixes(v_bucket_ids, v_names);RETURN NULL;END;$$;---- Name: prefixes_insert_trigger(); Type: FUNCTION; Schema: storage; Owner: ---CREATE FUNCTION storage.prefixes_insert_trigger() RETURNS triggerLANGUAGE plpgsqlAS $$BEGINPERFORM "storage"."add_prefixes"(NEW."bucket_id", NEW."name");RETURN NEW;END;$$;---- Name: search(text, text, integer, integer, integer, text, text, text); Type: FUNCTION; Schema: storage; Owner: ---CREATE FUNCTION storage.search(prefix text, bucketname text, limits integer DEFAULT 100, levels integer DEFAULT 1, offsets integer DEFAULT 0, search text DEFAULT ''::text, sortcolumn text DEFAULT 'name'::text, sortorder text DEFAULT 'asc'::text) RETURNS TABLE(name text, id uuid, updated_at timestamp with time zone, created_at timestamp with time zone, last_accessed_at timestamp with time zone, metadata jsonb)LANGUAGE plpgsqlAS $$declarecan_bypass_rls BOOLEAN;beginSELECT rolbypassrlsINTO can_bypass_rlsFROM pg_rolesWHERE rolname = coalesce(nullif(current_setting('role', true), 'none'), current_user);IF can_bypass_rls THENRETURN QUERY SELECT * FROM storage.search_v1_optimised(prefix, bucketname, limits, levels, offsets, search, sortcolumn, sortorder);ELSERETURN QUERY SELECT * FROM storage.search_legacy_v1(prefix, bucketname, limits, levels, offsets, search, sortcolumn, sortorder);END IF;end;$$;---- Name: search_legacy_v1(text, text, integer, integer, integer, text, text, text); Type: FUNCTION; Schema: storage; Owner: ---CREATE FUNCTION storage.search_legacy_v1(prefix text, bucketname text, limits integer DEFAULT 100, levels integer DEFAULT 1, offsets integer DEFAULT 0, search text DEFAULT ''::text, sortcolumn text DEFAULT 'name'::text, sortorder text DEFAULT 'asc'::text) RETURNS TABLE(name text, id uuid, updated_at timestamp with time zone, created_at timestamp with time zone, last_accessed_at timestamp with time zone, metadata jsonb)LANGUAGE plpgsql STABLEAS $_$declarev_order_by text;v_sort_order text;begincasewhen sortcolumn = 'name' thenv_order_by = 'name';when sortcolumn = 'updated_at' thenv_order_by = 'updated_at';when sortcolumn = 'created_at' thenv_order_by = 'created_at';when sortcolumn = 'last_accessed_at' thenv_order_by = 'last_accessed_at';elsev_order_by = 'name';end case;casewhen sortorder = 'asc' thenv_sort_order = 'asc';when sortorder = 'desc' thenv_sort_order = 'desc';elsev_sort_order = 'asc';end case;v_order_by = v_order_by || ' ' || v_sort_order;return query execute'with folders as (select path_tokens[$1] as folderfrom storage.objectswhere objects.name ilike $2 || $3 || ''%''and bucket_id = $4and array_length(objects.path_tokens, 1) <> $1group by folderorder by folder ' || v_sort_order || ')(select folder as "name",null as id,null as updated_at,null as created_at,null as last_accessed_at,null as metadata from folders)union all(select path_tokens[$1] as "name",id,updated_at,created_at,last_accessed_at,metadatafrom storage.objectswhere objects.name ilike $2 || $3 || ''%''and bucket_id = $4and array_length(objects.path_tokens, 1) = $1order by ' || v_order_by || ')limit $5offset $6' using levels, prefix, search, bucketname, limits, offsets;end;$_$;---- Name: search_v1_optimised(text, text, integer, integer, integer, text, text, text); Type: FUNCTION; Schema: storage; Owner: ---CREATE FUNCTION storage.search_v1_optimised(prefix text, bucketname text, limits integer DEFAULT 100, levels integer DEFAULT 1, offsets integer DEFAULT 0, search text DEFAULT ''::text, sortcolumn text DEFAULT 'name'::text, sortorder text DEFAULT 'asc'::text) RETURNS TABLE(name text, id uuid, updated_at timestamp with time zone, created_at timestamp with time zone, last_accessed_at timestamp with time zone, metadata jsonb)LANGUAGE plpgsql STABLEAS $_$declarev_order_by text;v_sort_order text;begincasewhen sortcolumn = 'name' thenv_order_by = 'name';when sortcolumn = 'updated_at' thenv_order_by = 'updated_at';when sortcolumn = 'created_at' thenv_order_by = 'created_at';when sortcolumn = 'last_accessed_at' thenv_order_by = 'last_accessed_at';elsev_order_by = 'name';end case;casewhen sortorder = 'asc' thenv_sort_order = 'asc';when sortorder = 'desc' thenv_sort_order = 'desc';elsev_sort_order = 'asc';end case;v_order_by = v_order_by || ' ' || v_sort_order;return query execute'with folders as (select (string_to_array(name, ''/''))[level] as namefrom storage.prefixeswhere lower(prefixes.name) like lower($2 || $3) || ''%''and bucket_id = $4and level = $1order by name ' || v_sort_order || ')(select name,null as id,null as updated_at,null as created_at,null as last_accessed_at,null as metadata from folders)union all(select path_tokens[level] as "name",id,updated_at,created_at,last_accessed_at,metadatafrom storage.objectswhere lower(objects.name) like lower($2 || $3) || ''%''and bucket_id = $4and level = $1order by ' || v_order_by || ')limit $5offset $6' using levels, prefix, search, bucketname, limits, offsets;end;$_$;---- Name: search_v2(text, text, integer, integer, text, text, text, text); Type: FUNCTION; Schema: storage; Owner: ---CREATE FUNCTION storage.search_v2(prefix text, bucket_name text, limits integer DEFAULT 100, levels integer DEFAULT 1, start_after text DEFAULT ''::text, sort_order text DEFAULT 'asc'::text, sort_column text DEFAULT 'name'::text, sort_column_after text DEFAULT ''::text) RETURNS TABLE(key text, name text, id uuid, updated_at timestamp with time zone, created_at timestamp with time zone, last_accessed_at timestamp with time zone, metadata jsonb)LANGUAGE plpgsql STABLEAS $_$DECLAREsort_col text;sort_ord text;cursor_op text;cursor_expr text;sort_expr text;BEGIN-- Validate sort_ordersort_ord := lower(sort_order);IF sort_ord NOT IN ('asc', 'desc') THENsort_ord := 'asc';END IF;-- Determine cursor comparison operatorIF sort_ord = 'asc' THENcursor_op := '>';ELSEcursor_op := '<';END IF;sort_col := lower(sort_column);-- Validate sort columnIF sort_col IN ('updated_at', 'created_at') THENcursor_expr := format('($5 = '''' OR ROW(date_trunc(''milliseconds'', %I), name COLLATE "C") %s ROW(COALESCE(NULLIF($6, '''')::timestamptz, ''epoch''::timestamptz), $5))',sort_col, cursor_op);sort_expr := format('COALESCE(date_trunc(''milliseconds'', %I), ''epoch''::timestamptz) %s, name COLLATE "C" %s',sort_col, sort_ord, sort_ord);ELSEcursor_expr := format('($5 = '''' OR name COLLATE "C" %s $5)', cursor_op);sort_expr := format('name COLLATE "C" %s', sort_ord);END IF;RETURN QUERY EXECUTE format($sql$SELECT * FROM ((SELECTsplit_part(name, '/', $4) AS key,name,NULL::uuid AS id,updated_at,created_at,NULL::timestamptz AS last_accessed_at,NULL::jsonb AS metadataFROM storage.prefixesWHERE name COLLATE "C" LIKE $1 || '%%'AND bucket_id = $2AND level = $4AND %sORDER BY %sLIMIT $3)UNION ALL(SELECTsplit_part(name, '/', $4) AS key,name,id,updated_at,created_at,last_accessed_at,metadataFROM storage.objectsWHERE name COLLATE "C" LIKE $1 || '%%'AND bucket_id = $2AND level = $4AND %sORDER BY %sLIMIT $3)) objORDER BY %sLIMIT $3$sql$,cursor_expr, -- prefixes WHEREsort_expr, -- prefixes ORDER BYcursor_expr, -- objects WHEREsort_expr, -- objects ORDER BYsort_expr -- final ORDER BY)USING prefix, bucket_name, limits, levels, start_after, sort_column_after;END;$_$;---- Name: update_updated_at_column(); Type: FUNCTION; Schema: storage; Owner: ---CREATE FUNCTION storage.update_updated_at_column() RETURNS triggerLANGUAGE plpgsqlAS $$BEGINNEW.updated_at = now();RETURN NEW;END;$$;SET default_tablespace = '';SET default_table_access_method = heap;---- Name: audit_log_entries; Type: TABLE; Schema: auth; Owner: ---