MENT; Schema: auth; Owner: ---COMMENT ON TABLE auth.instances IS 'Auth: Manages users across multiple sites.';---- Name: mfa_amr_claims; Type: TABLE; Schema: auth; Owner: ---CREATE TABLE auth.mfa_amr_claims (session_id uuid NOT NULL,created_at timestamp with time zone NOT NULL,updated_at timestamp with time zone NOT NULL,authentication_method text NOT NULL,id uuid NOT NULL);---- Name: TABLE mfa_amr_claims; Type: COMMENT; Schema: auth; Owner: ---COMMENT ON TABLE auth.mfa_amr_claims IS 'auth: stores authenticator method reference claims for multi factor authentication';---- Name: mfa_challenges; Type: TABLE; Schema: auth; Owner: ---CREATE TABLE auth.mfa_challenges (id uuid NOT NULL,factor_id uuid NOT NULL,created_at timestamp with time zone NOT NULL,verified_at timestamp with time zone,ip_address inet NOT NULL,otp_code text,web_authn_session_data jsonb);---- Name: TABLE mfa_challenges; Type: COMMENT; Schema: auth; Owner: ---COMMENT ON TABLE auth.mfa_challenges IS 'auth: stores metadata about challenge requests made';---- Name: mfa_factors; Type: TABLE; Schema: auth; Owner: ---CREATE TABLE auth.mfa_factors (id uuid NOT NULL,user_id uuid NOT NULL,friendly_name text,factor_type auth.factor_type NOT NULL,status auth.factor_status NOT NULL,created_at timestamp with time zone NOT NULL,updated_at timestamp with time zone NOT NULL,secret text,phone text,last_challenged_at timestamp with time zone,web_authn_credential jsonb,web_authn_aaguid uuid,last_webauthn_challenge_data jsonb);---- Name: TABLE mfa_factors; Type: COMMENT; Schema: auth; Owner: ---COMMENT ON TABLE auth.mfa_factors IS 'auth: stores metadata about factors';---- Name: COLUMN mfa_factors.last_webauthn_challenge_data; Type: COMMENT; Schema: auth; Owner: ---COMMENT ON COLUMN auth.mfa_factors.last_webauthn_challenge_data IS 'Stores the latest WebAuthn challenge data including attestation/assertion for customer verification';---- Name: oauth_authorizations; Type: TABLE; Schema: auth; Owner: ---CREATE TABLE auth.oauth_authorizations (id uuid NOT NULL,authorization_id text NOT NULL,client_id uuid NOT NULL,user_id uuid,redirect_uri text NOT NULL,scope text NOT NULL,state text,resource text,code_challenge text,code_challenge_method auth.code_challenge_method,response_type auth.oauth_response_type DEFAULT 'code'::auth.oauth_response_type NOT NULL,status auth.oauth_authorization_status DEFAULT 'pending'::auth.oauth_authorization_status NOT NULL,authorization_code text,created_at timestamp with time zone DEFAULT now() NOT NULL,expires_at timestamp with time zone DEFAULT (now() + '00:03:00'::interval) NOT NULL,approved_at timestamp with time zone,nonce text,CONSTRAINT oauth_authorizations_authorization_code_length CHECK ((char_length(authorization_code) <= 255)),CONSTRAINT oauth_authorizations_code_challenge_length CHECK ((char_length(code_challenge) <= 128)),CONSTRAINT oauth_authorizations_expires_at_future CHECK ((expires_at > created_at)),CONSTRAINT oauth_authorizations_nonce_length CHECK ((char_length(nonce) <= 255)),CONSTRAINT oauth_authorizations_redirect_uri_length CHECK ((char_length(redirect_uri) <= 2048)),CONSTRAINT oauth_authorizations_resource_length CHECK ((char_length(resource) <= 2048)),CONSTRAINT oauth_authorizations_scope_length CHECK ((char_length(scope) <= 4096)),CONSTRAINT oauth_authorizations_state_length CHECK ((char_length(state) <= 4096)));---- Name: oauth_clients; Type: TABLE; Schema: auth; Owner: ---CREATE TABLE auth.oauth_clients (id uuid NOT NULL,client_secret_hash text,registration_type auth.oauth_registration_type NOT NULL,redirect_uris text NOT NULL,grant_types text NOT NULL,client_name text,client_uri text,logo_uri text,created_at timestamp with time zone DEFAULT now() NOT NULL,updated_at timestamp with time zone DEFAULT now() NOT NULL,deleted_at timestamp with time zone,client_type auth.oauth_client_type DEFAULT 'confidential'::auth.oauth_client_type NOT NULL,CONSTRAINT oauth_clients_client_name_length CHECK ((char_length(client_name) <= 1024)),CONSTRAINT oauth_clients_client_uri_length CHECK ((char_length(client_uri) <= 2048)),CONSTRAINT oauth_clients_logo_uri_length CHECK ((char_length(logo_uri) <= 2048)));---- Name: oauth_consents; Type: TABLE; Schema: auth; Owner: ---CREATE TABLE auth.oauth_consents (id uuid NOT NULL,user_id uuid NOT NULL,client_id uuid NOT NULL,scopes text NOT NULL,granted_at timestamp with time zone DEFAULT now() NOT NULL,revoked_at timestamp with time zone,CONSTRAINT oauth_consents_revoked_after_granted CHECK (((revoked_at IS NULL) OR (revoked_at >= granted_at))),CONSTRAINT oauth_consents_scopes_length CHECK ((char_length(scopes) <= 2048)),CONSTRAINT oauth_consents_scopes_not_empty CHECK ((char_length(TRIM(BOTH FROM scopes)) > 0)));---- Name: one_time_tokens; Type: TABLE; Schema: auth; Owner: ---CREATE TABLE auth.one_time_tokens (id uuid NOT NULL,user_id uuid NOT NULL,token_type auth.one_time_token_type NOT NULL,token_hash text NOT NULL,relates_to text NOT NULL,created_at timestamp without time zone DEFAULT now() NOT NULL,updated_at timestamp without time zone DEFAULT now() NOT NULL,CONSTRAINT one_time_tokens_token_hash_check CHECK ((char_length(token_hash) > 0)));---- Name: refresh_tokens; Type: TABLE; Schema: auth; Owner: ---CREATE TABLE auth.refresh_tokens (instance_id uuid,id bigint NOT NULL,token character varying(255),user_id character varying(255),revoked boolean,created_at timestamp with time zone,updated_at timestamp with time zone,parent character varying(255),session_id uuid);---- Name: TABLE refresh_tokens; Type: COMMENT; Schema: auth; Owner: ---COMMENT ON TABLE auth.refresh_tokens IS 'Auth: Store of tokens used to refresh JWT tokens once they expire.';---- Name: refresh_tokens_id_seq; Type: SEQUENCE; Schema: auth; Owner: ---CREATE SEQUENCE auth.refresh_tokens_id_seqSTART WITH 1INCREMENT BY 1NO MINVALUENO MAXVALUECACHE 1;---- Name: refresh_tokens_id_seq; Type: SEQUENCE OWNED BY; Schema: auth; Owner: ---ALTER SEQUENCE auth.refresh_tokens_id_seq OWNED BY auth.refresh_tokens.id;---